wikibase-dispatchstats-intro:
Эта страница содержит статистические данные о процессе рассылки клиентам изменений в базе данных. Клиентский вики-проект уведомляется об изменениях на сайте «{{SITENAME}}»,  как только изменения были отправлены в этот вики-проект, и уведомление было обработано очередью заданий для этой вики.
* {{int:wikibase-dispatchstats-changes}}  показывает количество, а также дату старейших и самых последних элементов, находящихся в настоящее время в очереди.
* {{int:wikibase-dispatchstats-stats}} содержит информацию о наиболее и наименее отставших в смысле обновлений клиентских вики-проектах, а также среднее значение отставания. По каждому вики-проекту предоставляется следующая информация:
** «{{int:wikibase-dispatchstats-site-id}}» — внутренний идентификатор клиентского вики-проекта;
** «{{int:wikibase-dispatchstats-pos}}» — идентификатор последнего изменения,  отправляенного в этот вики-проект;
** «{{int:wikibase-dispatchstats-lag-num}}» — количество изменений, которые еще не переданы в клиентский вики-проект;
** «{{int:wikibase-dispatchstats-lag-time}}» — время между последним отправленным изменением и последним изменением на сайте «{{SITENAME}}»;
** «{{int:wikibase-dispatchstats-touched}}» — время, когда последний пакет изменений был отправлен в клиентский вики-проект.
